(1, 'INE540G01014', 'AMBIKA COTTON MILLS LTD', 'AMBIKCO', 'Ambika Cotton Mills Limited (ACML) is engaged in manufacturing and selling specialty cotton yarn. The Company operates through two segments, including Textiles and Windmills.', 'Textiles', '0000-00-00', 'N'),
(2, 'INE435A01028', 'Andhra Paper Ltd', 'ANDHRAPAP', 'International Paper APPM Limited, formerly The Andhra Pradesh Paper Mills Limited, is an integrated paper and pulp manufacturing company.', 'Paper & Paper Products', '0000-00-00', 'N'),
(3, 'INE294Z01018', 'The Anup Engineering Ltd', 'ANUP', 'Anup Engineering Ltd is focused on manufacturing and fabrication of engineering goods.The Company serves various industries, such as oil and gas, petrochemicals, fertilizer, chemicals, power, water and aerospace.', 'Industrial Machinery', '0000-00-00', 'N'),
(4, 'INE372A01015', 'APAR INDUSTRIES LTD', 'APARINDS', 'Apar Industries Limited (Apar) is engaged in the business of manufacture of conductors, transformer/specialty oils and power/telecom cables.', 'Other Elect.Equip./ Prod.', '0000-00-00', 'N'),
(5, 'INE116A01032', 'APCOTEX INDUSTRIES LTD', 'APCOTEXIND', 'Apcotex Industries Limited is engaged in the business of producing synthetic emulsion polymers. The Companys range of latexes is used for Tire cord dipping, paper/board coating, carpet backing etc.', 'Other Industrial Goods', '0000-00-00', 'N'),
(6, 'INE346W01013', 'Apex Frozen Foods Ltd', 'APEX', 'Apex Frozen Foods Limited is an India-based integrated producer and exporter of shelf stable aquaculture products. The Company produces two kinds of shrimps namely the black tiger shrimp (Penaeus mondon) and whiteleg shrimp (Litopenaeus vannamei). The black tiger shrimp is also known as giant tiger prawn or Asian tiger prawn. whiteleg shrimp is also known as Pacific white shrimp, which are sold under the brands: Bay fresh, Bay Harvest and BayPremium. The Company supplies ready-to-cook products to the food companies, retail chains, restaurants, and club stores. The Company distributes the products to the United States, the United Kingdom, and European Countries.', 'Packaged Foods', '0000-00-00', 'N'),
(7, 'INE713T01010', 'Apollo Micro Systems Ltd', 'APOLLO', 'Apollo Micro Systems Limited is an India-based electronic, electro-mechanical, engineering designs, manufacturing and supplies company. The Company design, develop and sell mission and time critical solutions to defense, space and home land security for ministry of defense, Government controlled public sector undertakings and private sectors. It offers custom built commercially off-the shelf solutions based on specific requirements to defense and space customers. It operates through six segments: defense avionic systems, defense-aerospace systems, defense-naval systems, satellite space systems, homeland security and telematics, transportation. Its solutions for avionics applications include Gimbal payload electronics and spread spectrum modem. Its on-board solutions include on-board computer and missile interface unit. It also offers telematic and integrated surveillance systems like integrated surveillance systems consisting of closed-circuit television (CCTV) and boom barriers.', 'Defence', '0000-00-00', 'N'),
(8, 'INE126J01016', 'Apollo Pipes Ltd', 'APOLLOPIPE', 'Apollo Pipes Limited, formerly Amulya Leasing and Finance Limited, is an India-based company, which is focused on the development, manufacturing and distribution of plastic piping systems. The Company is engaged in the business of manufacturing of multiple ranges of pipes, including chlorinated polyvinyl chloride (CPVC) pipes, unplasticised poly vinyl chloride (uPVC) pipes, high density polyethylene (HDPE) products, steel pipes and hollow section. The Company manufactures the plastic pipes under the brand name APL APOLLO. Its pipes and fittings are used in residential and commercial, hot and cold, and potable water distribution systems. The Company serves the customers in various sectors, including civil infrastructure, industrial, agriculture, and building and construction.', 'Plastic Products', '0000-00-00', 'N'),
(9, 'INE266F01018', 'APTECH LTD', 'APTECHT', 'Aptech Limited (Aptech) is a information technology (IT) training and education company. The Company operates through two segments: Individual Training and Enterprise Business.', 'IT Training Services', '0000-00-00', 'N'),
(10, 'INE109C01017', 'ARMAN FINANCIAL SERVICES LTD', 'ARMANFIN', 'Arman Financial Services Limited (AFSL) is an asset finance company (AFC), which is engaged in providing microfinance and financing the purchase of two- and three-wheelers.', 'Finance (including NBFCs)', '0000-00-00', 'N'),
(11, 'INE034A01011', 'ARVIND LTD', 'ARVIND', 'Arvind Limited is a textile company. The Companys principal products/services are finished fabrics and garments.', 'Textiles', '0000-00-00', 'N'),
(12, 'INE955V01021', 'Arvind Fashions Ltd', 'ARVINDFASN', 'Arvind Fashions is a textile company engaged in manufacturing and supplying denim and textile products worldwide.', 'Other Apparels & Accessories', '0000-00-00', 'N'),
(13, 'INE073G01016', 'ASSOCIATED ALCOHOLS & BREWERIES LTD', 'ASALCBR', 'Associated Alcohols & Breweries Limited is a distillery company. The Company is engaged in the manufacture of alcoholic liquor. It operates through Potable Alcohol segment.', 'Breweries & Distilleries', '0000-00-00', 'N'),
(14, 'INE365D01021', 'ASHIANA HOUSING LTD', 'ASHIANA', 'Ashiana Housing Limited is engaged in real estate activities with own or leased property. The Company operates through the Real Estate Business segment.', 'Realty', '0000-00-00', 'N'),
(15, 'INE022I01019', 'ASIAN GRANITO INDIA LTD', 'ASIANTILES', 'Asian Granito India Limited is engaged in the business of manufacturing of tiles. The Company offers tiles, including wall, vitrified and ceramics, and marble and quartz.', 'Furniture-Furnishing-Paints', '0000-00-00', 'N'),
(16, 'INE563J01010', 'ASTEC LIFESCIENCES LIMITED', 'ASTEC', 'Astec LifeSciences Limited is a holding company. The Company is a producer of agrochemicals and pharmaceutical intermediates.', 'Agrochemicals', '0000-00-00', 'N'),
(17, 'INE386C01029', 'ASTRA MICROWAVE PRODUCTS LTD', 'ASTRAMICRO', 'Astra Microwave Products Limited is engaged in designing and manufacturing of radio frequency (RF) and microwave super components and sub-systems finding applications in defense, space, telecom, meteorology and civil communication systems.', 'Defence', '0000-00-00', 'N'),
(18, 'INE646X01014', 'Astron Paper & Board Mill Ltd', 'ASTRON', 'Astron Paper & Board Mill is engaged in manufacturing Kraft paper. The Company offers various products, including high ring crush test (RCT) paper, Kraft liner, liner and corrugated medium paper', 'Paper & Paper Products', '0000-00-00', 'N'),
(19, 'INE209A01019', 'AGRO TECH FOODS LTD', 'ATFL', 'Agro Tech Foods Limited is engaged in the business of marketing food and food ingredients. The companys product offering edible oils and sprays; snacks; soups, puddings and desserts; spreads, and meals and meal enhancers.', 'Other Agricultural Products', '0000-00-00', 'N'),
(20, 'INE951D01028', 'ATUL AUTO LTD', 'ATULAUTO', 'Atul Auto Limited is a manufacturer of three-wheeled commercial vehicles in the state of Gujarat. The Company is a three-wheeler manufacturer of auto rickshaws, pick-up vans and chassis of passenger vehicles.', '2/3 Wheelers', '0000-00-00', 'N'),
(21, 'INE449A01011', 'AUTOMOTIVE AXLES LTD', 'AUTOAXLES', 'Automotive Axles Limited is engaged in the manufacturing of automotive axles. It provides its products to the domestic and global manufacturers of trucks and buses.', 'Auto Parts & Equipment', '0000-00-00', 'N'),
(22, 'INE349W01017', 'Avadh Sugar & Energy Ltd', 'AVADHSUGAR', 'Avadh Sugar & Energy Limited is engaged in manufacture and sale of sugar and its by-products and Spirits.', 'Sugar', '0000-00-00', 'N'),
(23, 'INE488D01021', 'AVT NATURAL PRODUCTS LTD', 'AVTNPL', 'AVT Natural Products Limited is engaged in the production of nutraceutical grade products. The Companys principal products/services are Marigold Oleoresins, Spice Oleoresins and De-caffeinated Tea.', 'Other Agricultural Products', '0000-00-00', 'N'),
(24, 'INE555B01013', 'Axiscades Technologies Ltd', 'AXISCADES', 'AXISCADES Engineering Technologies provides technology solutions at various stages of engineering product life-cycle development. The Company operates in three sectors: aerospace, heavy engineering and automotive and industrial products.', 'BPO/KPO', '0000-00-00', 'N'),
(25, 'INE306A01021', 'Bajaj Hindusthan Sugar Limited', 'BAJAJHIND', 'Bajaj Hindusthan Sugar Limited, formerly Bajaj Hindusthan Limited, is a holding company. The Company is engaged in the manufacture of sugar, alcohol and generation of power.', 'Sugar', '0000-00-00', 'N'),
(26, 'INE794B01026', 'BALAJI TELEFILMS LTD', 'BALAJITELE', 'Balaji Telefilms Limited (BTL) is a media and entertainment company. The Company is engaged in the production of television content.', 'Broadcasting & Cable TV', '0000-00-00', 'N'),
(27, 'INE050E01027', 'BALAJI AMINES LTD', 'BALAMINES', 'Balaji Amines Limited is a company, which is engaged in the manufacturing of Aliphatic Amines, their derivatives and specialty chemicals. The Company is running a five star hotel, Balaji Sarovar Premiere.', 'Specialty Chemicals', '0000-00-00', 'N'),
(28, 'INE213C01025', 'BANCO PRODUCTS (INDIA) LTD', 'BANCOINDIA', 'Banco Products (India) Limited is engaged in manufacturing and selling engine cooling products and sealing gaskets. It supplies for commercial vehicles, passenger vehicles and industrial products.', 'Auto Parts & Equipment', '0000-00-00', 'N'),
(29, 'INE464A01028', 'BHARAT BIJLEE LTD', 'BBL', 'Bharat Bijlee Limited offers electric motors and transformers. The Companys segments are Power Systems and Industrial Systems.', 'Other Elect.Equip./ Prod.', '0000-00-00', 'N'),
